$("#carouselExample").on("slide.bs.carousel",(function(e){var n=$(e.relatedTarget).index(),i=$(".carousel-item").length;if(n>=i-3)for(var o=4-(i-n),t=0;t<o;t++)"left"==e.direction?$(".carousel-item").eq(t).appendTo(".carousel-inner"):$(".carousel-item").eq(0).appendTo(".carousel-inner")})),$((function(){new Swiper(".swiper-container",{loop:!0,pagination:".swiper-pagination",paginationClickable:!0,nextButton:".swiper-button-next",prevButton:".swiper-button-prev"})}));